    data: |
      SELECT DISTINCT + col2 FROM tab1 (FORMAT parquet) WHERE + col0 / - - col0 * + 25 IN ( + col1, col1, + 42 + + col2 * - col0 * + 72 + + col0 * ( + - ( - ( - ( + - col0 ) ) ) ) * 42 + ( - col2 ) + col1 );
  - name: tab1

outputs:
  - name: q10433.out
    data: |
